        passWord=document.getElementById("pass").value
    }

    render() {
        return (
            <div>
                <Input id={"user"} />
                <Input id={"pass"} />
                <Button onClick={this.Login}>LOGIN</Button>
            </div>
        )
    }
} export default Head
